import Menu from './menu-aberto.png'
import Logo from './yt-logo.png'

function OpenLeftbar() {
    if (document.querySelector('.big-bar').classList.contains('open-big') && document.querySelector('.small-bar').classList.contains('open-small')) {
        document.querySelector('.big-bar').classList.remove('open-big')
        document.querySelector('.small-bar').classList.remove('open-small')
        
    } else {
        document.querySelector('.big-bar').classList.add('open-big')
        document.querySelector('.small-bar').classList.remove('open-small')
    }
}

export default () => 
        <div className="youtube-menu">
        <span onClick={OpenLeftbar}><img src={Menu} alt="" /></span>
        <span className='yt-logo'><img src={Logo} alt="" /></span>
        </div>
